description:
The Story of Men Who Wander. And Women Who Wonder.

What makes a man turn away from the woman he love, to seek the arms of another? What makes his wife look the other way...or look for another? This is the tale of Jack and Diane and Christine...an executive, his wife, his mistress.

This is their tale of passion, lust, and risk. As told by Massrs Armstrong and Steel, the most daring new directorial team in today's adult DVD.

